import React, {BrowserRouter as Router, Switch, Route, NavLink}from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <p>Hello</p>
        </Switch>
      </Router>
    </div>
  );
}



const Header = () => {
  return(
    <div>
      <NavLink to='/'>Home</NavLink>
      <NavLink to='/product'>product</NavLink>
      <NavLink to='/about'>about</NavLink>
    </div>
  )
}

const Home = () => <div>Home</div>
const Product = () => <div>Product</div>
const About = () => <div>About</div>

export default App;
